import { Link } from "react-router-dom";
import { Container, Typography, Button } from "@mui/material";
import { makeStyles } from "@mui/styles";
import forbiddenImage from "../../images/forbidden.jpg";

const useStyles = makeStyles((theme) => ({
  container: {
    textAlign: "center",
    marginTop: theme.spacing(4),
  },
  image: {
    width: "100%",
    maxWidth: 300,
    marginBottom: theme.spacing(2),
  },
  paragraph: {
    marginBottom: theme.spacing(2),
  },
}));

function EmployeeForbidden() {
  const classes = useStyles();

  return (
    <Container className={classes.container}>
      <img src={forbiddenImage} alt="Forbidden" className={classes.image} />
      <Typography variant="body1" className={classes.paragraph}>
        Employees are not authorized to access this page.
      </Typography>
      <Button component={Link} to="/home" variant="contained" color="primary">
        Go back to home page
      </Button>
    </Container>
  );
}

export default EmployeeForbidden;
